import { Box, Container, Stack } from "@mui/material";

import { styled } from '@mui/system';
import  useMediaQuery  from '../hooks/useMediaQuery';

import { motion } from "framer-motion";

const Header = () => {
  
  const Media = useMediaQuery("(min-width:1070px)")
  return (
    <div>
      <Container maxWidth={"xl"}>
        <Box
          width={"100%"}
          height={"100vh"}
          display={"flex"}
          justifyContent={"center"}
          alignItems={"center"}
        
        >
          <Stack direction={`${Media?"row":"column"}`} spacing={4} width={`${Media ? "100%":"80%"}`} height={`${ Media? "100%" : "60%" }`}  display={"flex"} justifyContent={"space-between"} style={{ backgroundColor:"black" }} >
            <Stack width={`${Media?"700px":"80%"}`}  height={`${Media? "650px " : "60% "}`}>
              <h1 className="text-white">hello</h1>
            </Stack>
            <Stack width={`${Media?"700px":"80%"}`} style={{ backgroundColor:"blueviolet" }} height={`${Media? "650px " : "60% "}`}>
              <h1 className="text-white">hello</h1>
            </Stack>  
          </Stack>
        </Box>
      </Container>
    </div>
  );
};

export default Header;
